//import { useState } from 'react'

function Containers() {
  //const [count, setCount] = useState(0)

  const containerIdInput = document.getElementById("containerId");

  function stopContainer() {
    let data = containerIdInput.value;
    let url = "https://solid-pancake-57qrww64ggf4w44-3000.app.github.dev/docker/stop";
    fetch(url, {
      method: "POST",
      headers: {
        "Content-Type": "application/json",
      },
      body: JSON.stringify({
        id: data
      })
    })
    .then((res) => res.json())
    .then(data => console.log(data))
    .catch(error => console.error('Error:', error));
  };

  return (
    <>
      <button onClick={stopContainer}>Stop Container</button>
    </>
  )
};

export default Containers
